import './App.css';
import HandWave from './assets/hand-regular.svg'
import NewWave from './assets/hand-wave.png'

function App() {
  return (
    <div className="App">
      <p>Hello World</p>
      <button class="button">Click Me</button>
      <img className='rotate' src={NewWave} alt='Hand Wave' />
      <div> Icons made by <a href="https://www.flaticon.com/authors/prashanth-rapolu-15" title="Prashanth Rapolu 15"> Prashanth Rapolu 15 </a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com'</a></div>
      <img className='rotate' src={HandWave} alt='Hand Wave' />
    </div>
  );
}

export default App;
